import Navbar from "./Navbar";
import Home from ""

function App() {
  const title = "Welcome to the new blog";
  const likes = [55, 66, 77];
  const like = 100;
  return (
    <div className="App">
      <Navbar />
      <div className="content">
        <h1>{title}</h1>
        <p>{like}</p>
      </div>
    </div>
  );
}

export default App;
